import React, { Component } from 'react'
import { Navbar, Nav} from 'react-bootstrap';
import Container from 'react-bootstrap/Container';
import { BrowserRouter as Router,Routes,Route, Link } from 'react-router-dom';
import LOGO from './img/LOGO.png';


import Beranda from './Beranda';
import Toko from './Toko';
import Aktivitas from './Aktivitas';
import About from './About';

class NavbarComp extends Component {
  render() {
    return (
      
      <div>
             <nav class="navbar navbar-expand-lg navbar-dark fixed-top navbar-nav-scroll" data-aos="fade-down" style="background-color: #2e2e2efd" shadow-sm>
      <div class="container" data-aos="fade-down" data-aos-duration="1000">
        <a class="navbar-brand fs-4 text-warning" href="https://instagram.com/zarazzarr/"><i class="bi bi-bookmark-heart-fill"></i> Azzar Rizky</a>
        <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
          <span class="navbar-toggler-icon"></span>
        </button>
        <div class="collapse navbar-collapse" id="navbarNavAltMarkup">
          <div class="navbar-nav ms-auto fw-bold">
            <a class="nav-link active" aria-current="page" href="#Home" data-aos="fade-down" data-aos-delay="200">Home</a>
            <a class="nav-link" href="#aboutme" data-aos="fade-down" data-aos-delay="400">About me</a>
            <a class="nav-link" href="#activity" data-aos="fade-down" data-aos-delay="600">Activity</a>
            <a class="nav-link" href="#contact" data-aos="fade-down" data-aos-delay="800">Contact</a>
          </div>
        </div>
      </div>
    </nav>
      </div>
      

      
      
        
      
      
      
    )
  }
}

export default NavbarComp;
